export default function QuoteGenerator(){

    const quotes = ["Terraforming or terraformation literally means \"Earth-Shaping\" ",
    "The concept of terraforming developed from both science fiction and actual science.",
"The term was coined by Jack Williamson in a science-fiction short story \"Collision Orbit\" published in 1942 in Astounding Science Fiction, although terraforming in popular culture may predate this work.",
"It Works, but it SUCKS"]

};
